  `ipport` int(11) DEFAULT NULL COMMENT '端口号',
  `userid` varchar(255) DEFAULT NULL COMMENT '对应用户的ID或账号',
  `online` int(11) DEFAULT '0' COMMENT '0：不在线；1：在线',
  `updatetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

