INSERT INTO `fruit` VALUES ('1', '茵红李', '茵红李为乔木植物，是引进品种中经优化选育成的地方品种。中国四川省宜宾和卧龙均有分布。', '1,2,3,4', 'http://tfile.melinked.com/2019/03/1fcf272e-e86b-4785-91b7-3244c583e156.jpg,\r\nhttp://tfile.melinked.com/2019/03/09ed6408-d8e2-4eeb-a71c-ddc36ad13802.jpg,\r\nhttp://tfile.melinked.com/2019/03/be82d6c6-9390-4134-a265-c4f04f7f7617.jpg,\r\nhttp://tfile.melinked.com/2019/03/d7da2297-00cb-4c52-83d5-69604474fb19.jpg,\r\nhttp://tfile.melinked.com/2019/03/bed3e076-1334-4417-8a8b-c1d4051804f7.jpg', 'http://imfile.melinked.com/2019/03/f570a158-d11b-4677-a29b-6aee4a8fe030.mp4', '四川.宜宾.屏山', null, 'https://baike.baidu.com/item/%E8%8C%B5%E7%BA%A2%E6%9D%8E/8455984?fr=aladdin');
INSERT INTO `fruit` VALUES ('2', '椪柑', '椪柑又名芦柑，皮薄易剥，色泽鲜美，果肉橙红色，汁多、组织紧密、浓甜脆嫩，化渣爽口、籽少，且有药用功效。适合南方各省生长。椪柑分硬芦和有芦。硬芦因果顶部有数条放射状沟纹而又称八卦芦，果实扁圆或高扁圆形；有芦，果顶部一般无放射状沟纹，果实扁圆形，单果重和果实风味不如硬芦。橙柑的主要特点：树势中等，树性直立，骨干枝分枝角度小；果实扁圆形，较大，单果重125～150克，大的可达250克以上，果面橙黄色或橙色，果皮稍厚，易剥；果肉脆嫩、多汁，甜浓爽口，可溶性固形物15%左右，糖含量11～13克/100毫升，酸含量0.3克～0.8克/100毫升；果实11月中、下旬至12月成熟，较耐贮藏。椪柑适应性广，丰产稳产，优系(优株)多，是目前我国发展的品种。', '20,21,22', 'http://tfile.melinked.com/2019/03/fcb9c5f0-82f8-46dd-b8a4-4d8a71e537b7.jpg,\r\nhttp://tfile.melinked.com/2019/03/c95a53e0-cee4-469d-b6ba-bfbee9d682bf.jpg,\r\nhttp://tfile.melinked.com/2019/03/2969fbd9-ad50-447b-8e07-84079db3e0da.jpg,\r\nhttp://tfile.melinked.com/2019/03/522aec8d-7cbf-4ce0-9570-5ce92c7c9100.jpg,\r\nhttp://tfile.melinked.com/2019/03/70ca47ef-9aae-441d-a868-d4e0713d6922.jpg', 'http://imfile.melinked.com/2019/03/d8ab63cb-ecf9-4eb5-ab38-7ace3fa3f175.mp4', '四川.宜宾.屏山', null, 'https://baike.baidu.com/item/%E6%A4%AA%E6%9F%91');
