INSERT INTO `potato` VALUES ('1', '狼牙土豆', '狼牙土豆是四川的一种地方风味小吃，是由四川小吃“天蚕土豆”改进而来，多在街头巷尾摆摊设点，现炸现卖，是家喻户晓的饭后小食。在其他地区也称之为炸洋芋，口味也不尽相同。\r\n\r\n\r\n\r\n主料为土豆，用特制刀具将土豆切成波浪外型，因恰似犬齿而得名，再配以其他时令蔬菜一起炸后再佐以其他香辛料拌食，香味四起，满街飘香，有很高的营养价值。', '', 'http://tfile.melinked.com/2019/02/cd30381b-a33d-4497-b2d7-67e3905c8354.jpg,\r\nhttp://tfile.melinked.com/2019/02/4f9e0578-c27f-4aff-ab64-8fca06fd66aa.jpg,\r\nhttp://tfile.melinked.com/2019/02/7222f4d7-696e-43a2-b787-7b1837ca0bd4.png,\r\nhttp://tfile.melinked.com/2019/02/8a92dca3-d614-4d28-8a0c-2a3227f5a9b6.png', 'http://tfile.melinked.com/2019/02/4bb31304-4e7d-4323-a1c4-88aa06e47b77.mp4', '', null, '');
INSERT INTO `potato` VALUES ('2', '锅巴土豆', '锅巴土豆是由土豆等主要食材做成的一道菜品，属于家常菜。主料有土豆，辅料有葱花、盐、胡椒粉、孜然粉、辣椒粉等。', '', 'http://tfile.melinked.com/2019/02/8d65e293-dfab-463e-9a57-15c2975cf333.jpg,\r\nhttp://tfile.melinked.com/2019/02/81b75d97-6f85-4c68-998c-08484c7926b2.jpg,\r\nhttp://tfile.melinked.com/2019/02/7bf1d109-3a4d-46f4-a9b6-1c1ddf10ea8d.png', 'http://tfile.melinked.com/2019/02/d8e6e345-2f28-4a12-8060-9e484a44b73d.mp4', '', null, '');
INSERT INTO `potato` VALUES ('3', '土豆饼', '土豆饼是一道以土豆、鸡蛋、面粉作为主要食材制作而成的美食，源自安徽和广东广州的传统小吃，属于徽菜、粤菜系。口味鲜美，营养丰富。', null, 'http://tfile.melinked.com/2019/02/e47d3962-87c6-40eb-9cda-8829e9977f21.jpg,\r\nhttp://tfile.melinked.com/2019/02/fd558f8d-383d-487b-813e-e780f80d3a83.jpg,\r\nhttp://tfile.melinked.com/2019/02/b739f598-cbf4-45f6-a065-66ad05bf23e1.jpg,\r\nhttp://tfile.melinked.com/2019/02/6067f08a-ae0d-4601-aa16-ee8c7344060c.png', 'http://tfile.melinked.com/2019/02/868abfc5-0c70-415c-94be-5384d4759493.mp4', null, null, null);
INSERT INTO `potato` VALUES ('4', '香煎小土豆', '香煎小土豆是一道主要由小土豆、大蒜制作的美味家常菜。', null, 'http://tfile.melinked.com/2019/02/02d2779b-6a5d-42b4-9f81-ee214075eaa3.jpg,\r\nhttp://tfile.melinked.com/2019/02/42d8ef55-09d7-4fe7-9ddc-0802f9897ff2.jpg,\r\nhttp://tfile.melinked.com/2019/02/6b93b7f5-3ea0-4071-bca3-10d5961c9dcb.jpg,\r\nhttp://tfile.melinked.com/2019/02/00884aac-b823-4d0f-9e07-1dfdb9cf8b6c.jpg,\r\nhttp://tfile.melinked.com/2019/02/970b20cb-2410-42c5-ae00-c4c7414dca6b.png', 'http://tfile.melinked.com/2019/02/152394e3-3fa5-4f20-90f2-270809d24967.mp4', null, null, null);
